import MovieItem from "../Movie/MovieItem";

const MovieList = (props) => {
  const { movies } = props;
  console.log(movies);
  return (
    <div className="row">
      {movies.map((movie) => {
        // let classes = `${this.state.colValue} col-md-6 mb-4`;
        return (
          <div>
            <MovieItem
              title={movie.title}
              imageUrl={movie.imageUrl}
              date={movie.date}
            />
          </div>
        );
      })}
    </div>
  );
};

export default MovieList;
